import React from 'react';
import { Link } from 'react-router-dom'

class MenuBar extends React.Component {
  render() {
    return (
      <section className="section-menubar">
        <Router>
        <Link to="/login">Login</Link>
        <Link to="/">Login</Link>
        </Router>
      </section>
    );

}
}

export default MenuBar;
